import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import UrlForm from './components/UrlForm';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<UrlForm />} />
      </Routes>
    </Router>
  );
}

export default App;
